export const GET_CITIES_LIST = 'GET_CITIES_LIST'
export const REQUEST_WEATHER_DETAILS = 'REQUEST_WEATHER_DETAILS'

export const getCitiesList = (city_name) => {
  return {
    type: GET_CITIES_LIST,
    payload: city_name
  };
};

export const requestWeatherDetails = (city_code) => {
  return {
    type: REQUEST_WEATHER_DETAILS,
    payload: city_code
  };
};
